import React from 'react';
import Login from './components/Login';
import CreateAccount from './components/CreateAccount';
import CarList from './components/CarList';

function App() {
  return (
    <div className="App">
      <h1>Welcome to the Car Bidding System</h1>
      <Login />
      <CreateAccount />
      <CarList />
    </div>
  );
}

export default App;
